def ReverseComplement (Pattern):
    Reverse = ""
    for j in Pattern:
        i = ""
        if   j == "A": i = "T"
        elif j == "T": i = "A"
        elif j == "C": i = "G"
        elif j == "G": i = "C"
        Reverse = i + Reverse
    return Reverse
